import React from "react";

export default function SearchTask() {
  return (
    <div
      className="doing-tasks__bar position-absolute align-items-center"
      style={{
        display: "flex",
        right: "0",
        width: "30rem",
        paddingRight: "1.3rem",
        borderRadius: "1.3rem",
        border: "3px solid var(--background-color-header)",
      }}
    >
      <div className="doing-tasks__input w-100">
        <input
          type="text"
          placeholder="Input tasks name"
          className="w-100 input--none-border"
          style={{
            fontSize: "1.6rem",
          }}
        />
      </div>

      <div className="doing-tasks__button">
        <ion-icon
          name="search"
          style={{
            fontSize: "2rem",
            cursor: "pointer",
          }}
        ></ion-icon>
      </div>
    </div>
  );
}
